function unpack (str) {
  let words = [];
  let head = '';
  let w = '';
  const flush = () => {
    w && words.push(w);
    w = '';
  };
  for (let c, i = 6; c = str[i]; i++) {
    if (c === '_') {
      flush();
      head = str[++i];
    }
    else if (/^[A-ZÁÉÍÓÚÝÞÆÐÖ]/.test(c)) {
      flush();
      w = head + c.toLowerCase();
    }
    else {
      w += c;
    }
  }
  flush();
  return { key: str.slice(0, 6), words };
}

